script: |
  super -f text -I q7639.spq | sort > q7639.out

inputs:
  - name: q7639.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + 81 * - 65 NOT BETWEEN - ( col1 ) * col0 + 36 * col1 AND col1 * col2;
  - name: tab1

outputs:
  - name: q7639.out
    data: |
      51	14	96
      85	5	59
      91	47	68
